import Link from "next/link";
import NavBar from "../componts/NavBar";
export default function Index() {
  return (
    <div>
      <NavBar />
      <Link href='/About'>
        <button>About</button>
      </Link>
      <h1>Hello from NextJs</h1>
    </div>
  );
}
